import React from 'react';
// import Myapp from './component/input_test';
import { BrowserRouter,  Route ,Switch} from "react-router-dom";
import Myapp from './component/input_test';
import Picture from './component/test';


function App(){
  return(
    <div>
    <BrowserRouter>
        <Switch>
        <Route path="/" element={Picture} exact />
        <Route path="/input_test" element={Myapp} />
        </Switch> 
    </BrowserRouter>
      <Picture/>

    </div>

  )
}
export default App;



